import React from 'react';
import { Typography } from '@mui/material';

function EventsList() {

    function goToUrl(url) {
        window.location.replace(url);
    }

    return (
        <div>
            <div style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
                <img src="path/to/your/image.jpg" alt="Image" style={{ width: "200px", height: "200px" }} />
                <div style={{ margin: "10px 0" }}>
                    <Typography sx={{ color: "#152a51", margin: "10px 30px 10px 30px" }} variant="h6">
                        Mark your calendars! ECE Dinner Dance will return on February 16th, 2023! 
                        Our venue this year is Chateau Le Jardin, a gorgeous mansion located in the heart of Woodbridge, ON, and able to accommodate up to 400 people. 
                        Dinner Dance tickets will include a 3-course meal, an open bar, a DJ + music, and transportation. 
                    </Typography>
                </div>
            </div>
            <div style={{ borderRadius: "20px", background: "white", padding: "20px", margin: "10px 30px 18px 30px" }}>
                <Typography onClick={() => goToUrl("https://courses.skule.ca/")} sx={{ cursor:'pointer', color: "#152a51", margin: "10px 30px 10px 30px" }} variant="h5">
                    2. Skule Courses
                </Typography>
                <Typography sx={{ color: "#152a51", margin: "10px 30px 10px 30px" }} variant="h6">
                    The Skule Courses website managed by the University of Toronto Engineering Society. 
                    An archive of U of T Engineering courses, with past midterms, exams, notes, syllabi, and more.
                </Typography>
            </div>
        </div>
    )
}

export default EventsList;
